public class text08{
    public static void main(String[] args) {
        int [][] arr=new int [][] {{1,2,3,4},{2,4,5,6},{0,2,35,5},{4,5,8,1}};
    
    for(int i=0;i<arr.length;i++){
        System.out.println();
        for(int j=0;j<arr[i].length;j++){
            System.out.print(arr[i][j]+"\t");
        }
    }
    }
    
}
